With fully secured bio-metric based authentication, the simple and intuitive app offers you peace of mind for your everyday banking activity. It is designed to offer a multitude of functions, from balance inquiry, bill payments to quick transactions. 

Using the BNF Mobile App you can: 
•	keep an eye out and take control of your finances;
•	swiftly view account balances and transactions;
•	transfer money securely between own accounts;
•	make quick payments, pay utility bills and much more;
•	send a secure message to our Customer Care team; and
•	log on a unique security device with your fingerprint or password ID.
Simple and Secure, more control for you!

Welcome to the new UniCredit Bank mobile app!

General features
— search for ATMs and branches of UniCredit Bank and partners, work schedule and route;
— UniCredit Bank news;
— contact the bank, send an e-mail or call the bank;
— tariffs for accounts and cards.

Cards
— information on your card and tariffs, obtaining details, setting restrictions and types of operations;
— remote issuance, replenishment and blocking of a debit card;
— history of card transactions, receipt of statement.

Deposits and current accounts
— information on deposits and accounts, obtaining details;
— history of operations on deposit or account, receipt of statement;
— replenishment, partial or early withdrawal, changing the parameters of deposits;
— Click savings account in rubles without commission for opening and maintenance.

Additional features
— transfers and payments through Fast payment system (FPS)
— transfers between your accounts;
— transfers by account or card number between cards of UniCredit Bank and other banks, or between cards of other banks;
— payment for utilities, internet, mobile communications and taxes;
— loans repayment from cards of other banks;
— viewing and sending card / account details via SMS or e-mail.

If you have any comments or suggestions, you can send us an email as an attachment via "More" → "Report an error".
Our mail is also available for this purpose: mobile.bank@unicredit.ru

Mobile.UniCredit is a mobile application of UniCredit Bank Russia that allows you to easily manage your finances. 
Basic features:
- ATM and branch locator;
- UniCredit Bank news and currency rates (for ATMs, exchange offices and non-cash transactions of individuals);
- info on UniCredit Bank special offers and products (with possibility to request for advice);
- recover password on the login screen;
- ability to remotely  connect to Enter.Unicredit;
- session key generating by mobile token ”MobiPass”.
Personal features: 
- information on customer’s accounts, cards, deposits and loans; 
- opening, replenish, partial withdrawal, early withdrawal and change parameters of deposits;
- opening savings account "Click" in rubles, dollars and euro without fees for opening and maintenance;
- ability to block, reissue card, notify the Bank about going abroad;
- ability to customize the types of transactions (cash withdrawals at ATMs, buying online and etc.) available on credit and debit cards;
- applying for a credit card, service package, cash loan and mortgage;
- transfer between customer’s accounts, including conversion; 
- transfer money by account number or card number between UniCredit Bank customers, transfers are made without commission;
- transfer money by card number : to card of another bank from UniCredit Bank card / from card of another bank  to UniCredit Bank card/ from card of another bank to card of another  bank, transfers are made with commission;
- ability to create ruble transfers to another bank;
- ability to create currency transfers;
- service payments to thousands of companies with no commission: utilities, internet, mobile and others; 
- ability to learn about the accrued traffic fines, taxes and pay for them with no commission;
- ability to send and get a letter from the Bank;
- templates to conduct transactions; 
- login and password change to enter the personal section, session keys’ card replacement; 
- nick names for customer’s banking products;
- confirmation of operations with session key sent via SMS or generated by mobile token ”MobiPass”;
- viewing and sharing of card/account requisites via SMS or email.

Personal features require subscription to Enter.UniCredit online banking. Enter.UniCredit as well as Mobile.UniCredit are free-of-charge services. 
After some time of client inactivity in personal part, session is closed automatically.
If you are already subscribed to Enter.UniCredit, use the same login and password in Mobile.UniCredit.

